import styled from "styled-components";

export const NavbarWrap = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;

  .iconReact,
  .iconReactNav {
    padding: 2rem;
    font-size: 2rem;

    &:hover {
      cursor: pointer;
    }
  }

  .iconReactNav {
    border-bottom: 1px solid #e5e5e5;
  }
`;

export const Navbar2Wrap = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: center;

  .iconReact,
  .iconReactNav {
    padding: 2rem;
    font-size: 2rem;
    display: flex;
    flex-direction: row;
    align-items: center;

    &:hover {
      cursor: pointer;
    }
  }

  .iconReactNav {
    border-bottom: 1px solid #e5e5e5;
  }

  .navHome,
  .navTrend,
  .navLib,
  .navSetting {
      marg
  }
`;
